import React from 'react';
import { View, Text, Button, StyleSheet, StatusBar } from 'react-native';

const pendentDeliveries = [
  {
    id: 1,
    color: "blue",
    text: "Request n1"
  },
  {
    id: 2,
    color: "red",
    text: "Request n8"
  },
];

const DeliveriesScreen = () => {

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Pendent Deliveries</Text>
      {pendentDeliveries.map((prop, key) => {
        return (
          <Text style={{backgroundColor : prop.color}}>{prop.text}</Text>
        );
      })}
      <Button onPress={() => navigation.navigate('Delivery')}>Delivery No929I293I23</Button>
    </View>

  );
};

export default DeliveriesScreen;

const styles = StyleSheet.create({
  title: {
    fontSize: 32
  },
  container: {
    flex: 1,
    padding: 20,
    paddingTop: 20,
    paddingBottom: 20,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  }
});
